var timerRef;

function isExpired(callback) {
    var ajaxCall = new XMLHttpRequest();
    ajaxCall.open("GET", "/orgid/expired", true);

    ajaxCall.onreadystatechange = function() {
        if (ajaxCall.readyState === 4) {
            if (ajaxCall.status === 200) {
                var response = JSON.parse(ajaxCall.response);

                if (response != null) {
                    callback(response.expired);
                }
            } else {
                clearInterval(timerRef);
            }
        } 
    };

    ajaxCall.send();
}

function pollSingleSignIn(params, callback) {
    if (timerRef) {
        clearInterval(timerRef);
    }

    timerRef = setInterval(function() {
            if (params.checkExpired) {
                isExpired(function(expired) {
                    if (expired) {
                        callback(params);
                    }
                });
            } else {
                callback(params);
            }
    }, params.pollDelay);
};

self.addEventListener("message", function (e) {
    if (e != null && e.data != null) {
        pollSingleSignIn(e.data, function (t) {
            postMessage(t);
        });
    }
}, false);

var aboutToExpireTimeouts = {};

function fetchAccessToken(accessTokenInfo, callback) {
    var ajaxCall = new XMLHttpRequest();
    ajaxCall.open("POST", accessTokenInfo.acquisitionEndpoint, true);

    if (accessTokenInfo.acquisitionEndpoint[0] !== "/") {
        ajaxCall.withCredentials = true;
    }

    ajaxCall.onreadystatechange = function() {
        if (ajaxCall.readyState === 4) {
            if (ajaxCall.status === 200) {
                var response = ajaxCall.responseText;
                callback(JSON.parse(response));
            } else {
                clearTimeout(aboutToExpireTimeouts[accessTokenInfo.resourceName]);
            }
        } 
    }

    ajaxCall.send();
}

function fetchOnExpires(expires, accessTokenInfo) {
    if (expires) {
        var now = new Date();
        var timeout = expires - now - 60000;
        timeout = timeout < 1 ? 60000 : timeout;
        aboutToExpireTimeouts[accessTokenInfo.resourceName] = setTimeout(function() { runFetch(accessTokenInfo); }, timeout);
    }
}

function runFetch(accessTokenInfo) {
    fetchAccessToken(accessTokenInfo, function (t) {
        postMessage(t);

        if (t.E && (t.V == null || t.pollVersion == null || t.V === accessTokenInfo.pollVersion)) {
            fetchOnExpires(t.E, accessTokenInfo);
        }
    });
}

self.addEventListener("message", function (e) {
    if (e == null || e.data == null) {
        return;
    }

    var accessTokenInfo = e.data;
    var name = accessTokenInfo.resourceName;

    if (typeof name !== "string" || name.length < 1) {
        return;
    }

    if (aboutToExpireTimeouts[name]) {
        clearTimeout(aboutToExpireTimeouts[name]);
    }

    if (accessTokenInfo.expires != null) {
        fetchOnExpires(accessTokenInfo.expires, accessTokenInfo);
    }
}, false);
